import React from 'react';
import { Button } from '@material-ui/core';
import styles from './DeleteUser.module.scss';
const DeleteUser = () =>{
    return(
        <div>
            <p>Bạn có chắc xóa user admin@gmail.com không?</p>
            <div>
            <Button variant='contained' className={styles['btn-delete']}>Xóa</Button>
            <Button variant='contained' className>Hủy</Button>
            </div>
        </div>
    )
}

export default DeleteUser;
